import { Link } from 'react-router-dom';
import {Wrap, Cover, Project} from './style';



const worklists = ({ dataSource }) => {
    return <Wrap>
        <ul>
            {
                dataSource && dataSource.map(item =>
                    <li key={item.id}>  
                        <Link to="/resume">

                            <Cover>
                                <img src={item.cover} alt="" />
                            </Cover>
                            <Project>

                            </Project>
                        </Link >
                    </li>  
                )
            }
        </ul>
    </Wrap>
}

export default worklists;
